function maxProfit(prices) {
    let maxProfit = 0;
    for (let buyIndex = 0; buyIndex < prices.length - 1; buyIndex++) {
        for (let sellIndex = buyIndex + 1; sellIndex < prices.length; sellIndex++) {
            if (prices[sellIndex] - prices[buyIndex] > maxProfit) {
                maxProfit = prices[sellIndex] - prices[buyIndex];
            }
        }
    }
    return maxProfit;
}
